import React from 'react'

const Filter =({value, onChange})=>{
    return(
        <label
            className={styles.label}
        >
        Find contacts by name:
            <input 
                type="text"
                name="filter"
                value={value}   
                onChange={onChange} 
            />                    
        </label>
    )
    
}

export default Filter;
